import "./FilterButtons.css";

const Filter = ({buttonText, button1, button2, setFilter}) => {
    return(
        <section className="FilterButtons">
            <button className="FilterButton" onClick={() => setFilter(button1)}> {buttonText}{button1 || "Placeholder"}</button>
            <button className="FilterButton" onClick={() => setFilter(button2)}> {buttonText}{button2 || "Placeholder"}</button>
        </section>
    )
}


export default Filter;
